Ext.data.JsonP['Mobile_Backend_Services_SDKs']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Mobile Backend Services SDKs</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-49153756\" class=\"content\">\n                        <h1>Mobile Backend Services SDKs</h1>\n    <p>In addition to the REST APIs, Mobile Backend Services provides several SDKs you can use to integrate Mobile Backend Services into your own native applications.    </p>\n<ul class=\" \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_and_Mobile_Backend_Services\">Titanium</a> applications can easily integrate with Mobile Backend Services using the <tt class=\" \">ti.cloud</tt> module, which ships with the Titanium SDK.    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/AMPLIFY_Appcelerator_Platform_Services_SDK_for_Android_Mobile_Backend_Services\">Android</a> applications can use the Mobile Backend Services Android SDK to integrate with Mobile Backend Services.    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/AMPLIFY_Appcelerator_Platform_Services_SDK_for_iOS_Mobile_Backend_Services\">iOS</a> applications can the use Mobile Backend Services iOS SDK to integrate with Mobile Backend Services.    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_SDK_for_Node.js\">Node.js</a> applications can the use Mobile Backend Services Node SDK to integrate with Mobile Backend Services.    </p>\n</li></ul>        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49153756\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Mobile Backend Services SDKs"});